import React, { Component } from 'react'
import { Modal, Button, Input } from 'antd';


 class Logout extends Component {
    render() {
        return (
            <div>
            <Modal
          title="Giris Yap"
          visible={this.state.visible}
          onOk={this.handleOk}
          onCancel={this.handleCancel}
        >
            <button>
            Çıkış Yap
            </button>
            </Modal>
                
            </div>
        )
    }
}
export default Logout  ;
